import React, { useState, useEffect } from 'react'
import styled from 'styled-components'

const FeedMain = props => {
  const Container = styled.div`
    display: flex;
    flex-direction: column;
    flex: 1 1 0%;
    background-color: #393945;
    /* position: relative;
    top: -160px; */
  `;


  const ListItem = styled.div`
    display: flex;
    background-color: #393945;
    /* height: 160px; */
    padding: 1rem 3rem;
    /* position: absolute; */
    margin-bottom: 2px;

  `;
  const ListContent = styled.div`
    display: flex;
    flex-direction: column;
    box-sizing:border-box;
    max-width: inherit;
    overflow: auto;
    text-overflow: ellipsis;
    white-space: nowrap;
    -webkit-line-clamp: 2;
    line-clamp: 2;
`;
  const MetaData = styled.div`
    margin-bottom: 6px;
  `;

  const Title = styled.div`
    display: flex;
    /* border: 1px solid white; */
    color: white;
    font-size: 14px;
    font-weight: 500;
    overflow: hidden;
    text-overflow: auto;
    text-overflow: ellipsis;
    white-space: nowrap;
    -webkit-line-clamp: 2;
    line-clamp: 2;
  `;

  const Description = styled.div`
    /* border: 1px solid white; */
    display: flex;
    color: white;
    font-size: 14px;
    margin-top: .5rem;
    overflow: auto;
    text-overflow: ellipsis;
    white-space: nowrap;
    -webkit-line-clamp: 2;
  `;

  return (
    <Container>

      {props.businessNews.map((ele, i) =>
        <ListItem>
          <ListContent>
            {/* <MetaData>AAPL</MetaData> */}
            <Title>
              {ele.title}
            </Title>
            <Description>
              {ele.description}
            </Description>

          </ListContent>
        </ListItem>
      )}
      {console.log(props)}
    </Container>
  );
}

export default FeedMain;
